  useEffect(()=>{
    axios.get('https://my-json-server.typicode.com/tractian/fake-api/units')
    .then(res =>{
      console.log(res)
    })
    .catch(err => {
      console.log(err)
    })
  })

  return(
    <div>
      {
        units.map(unit => <div key={unit.id}> {unit.name} </div>)
      }
    </div>
  )
}

export default Unidade;
